  `leave_date` date DEFAULT NULL COMMENT '离职日期',
  `leave_type` varchar(20) DEFAULT NULL COMMENT '离职方式',
  `leave_reasons` varchar(20) DEFAULT NULL COMMENT '离职原因',
  PRIMARY KEY (`employee_extend_id`)
